import React from "react";
import styleGlasses from "./Glasses.module.css";
import { Data } from "../Data";
import Button from "./Button";
const Glasses = (props) => {
  console.log(props);
  return (
    <div className={styleGlasses.glasses}>
      {Data.map((item) => (
       <Button image={item.image}></Button>
      ))}
    </div>
  );
};

export default Glasses;
